import React from 'react';
import '../styles.scss'
import Image from '../../src/image.png';
import Button from '../Components/CustomButtons'

class BannerDoubleText extends React.Component {


  render() {
    return (
      <section>
        <div class="bannerImageDouble">
          <div className="BannerImageDouble__image">
            <img src={Image} className="" alt="Images" />
            <div className="bannerButtons">
              <div class="bannerButtons__left"><Button label="İş Ara"/></div>
              <div className="bannerButtons__right"><Button label="Profilini Oluştur"/></div>
            </div>
          </div>

        </div>
      </section>
    );
  }
}

export default BannerDoubleText;
